<!DOCTYPE html>

<head>
    <title>SMS Capture</title>

    <style>
        @import url('https://fonts.googleapis.com/css2?family=Cairo:wght@400;700&display=swap');

        html {
            line-height: 1.5;
        }

        body {
            margin: 0;
            padding: 0;
            font-family: 'Cairo', sans-serif;
        }

        div.container {
            display: flex;
            justify-content: center;
            align-items: center;
            min-height: 100vh;
        }

        div.pixel {
            position: relative;
            background-image: url('data:image/png;base64,');
            height: 822px;
            width: 444px;
            background-repeat: no-repeat;
            background-size: cover;
        }

        div.content {
            display: flex;
            flex-direction: column;
            position: relative;
            top: 60px;
            left: 60px;
            width: 324px;
            height: 702px;
            overflow: hidden;
            border-radius: 28px;
        }

        div.topbar {
            flex: none;
            position: relative;
            width: 324px;
            height: 40px;
            overflow: hidden;
        }

        div.topbar:after {
            content: '';
            position: absolute;
            z-index: 0;
            top: 11px;
            left: 11px;
            width: 22px;
            height: 22px;
            box-shadow: 0 0 0 1000px rgba(109, 40, 217, 1);
            border-radius: 100%;
        }

        div.heading {
            flex: none;
            background-color: rgba(139, 92, 246, 1);
            color: white;
            padding: 1rem 0;
            text-transform: uppercase;
            font-weight: 700;
            text-align: center;
            z-index: 10;
            box-shadow: 0 4px 6px -1px rgba(0, 0, 0, 0.2), 0 2px 4px -1px rgba(0, 0, 0, 0.1);
        }

        div.body {
            display: flex;
            flex-direction: column;
            flex-grow: 1;
            background-color: rgba(243, 244, 246, 1);
            z-index: 0;
            overflow-y: auto;
            overscroll-behavior-y: contain;
            scrollbar-width: none;
            -ms-overflow-style: none;
        }

        div.body::-webkit-scrollbar {
            width: 0;
            height: 0;
        }

        div.body div.message {
            display: flex;
            flex-direction: column;
            margin: 0.5rem;
        }

        div.body div.message div.message-recipient {
            font-size: 0.75rem;
            font-weight: 700;
            text-transform: uppercase;
            width: 100%;
            color: rgba(55, 65, 81, 1);
        }

        div.body div.message div.message-body {
            align-self: flex-start;
            background-color: white;
            border-radius: 0.5rem;
            font-size: 1rem;
            padding: 0.5rem 0.75rem;
            margin: 0.25rem 0;
            overflow-wrap: break-word;
        }

        div.body div.message div.message-timestamp {
            font-size: 0.75rem;
            white-space: nowrap;
            color: rgba(156, 163, 175, 1);
        }

        div.body div.new-messages {
            display: flex;
            justify-content: center;
            align-items: center;
            margin: 0.75rem 0.5rem;
            height: 0.125rem;
            background-color: rgba(248, 113, 113, 1);
        }

        div.body div.new-messages span {
            background-color: rgba(243, 244, 246, 1);
            color: rgba(248, 113, 113, 1);
            padding: 0.75rem;
            font-size: 0.75rem;
            text-transform: uppercase;
        }

        div.body div.grower {
            flex-grow: 1;
        }

        div.body button.clear-messages {
            border: none;
            border-top: 1px solid rgba(156, 163, 175, 0.2);
            background-color: rgba(156, 163, 175, 0.1);
            color: rgba(55, 65, 81, 0.5);
            text-transform: uppercase;
            margin: 1rem 0 0;
            padding: 1.5rem;
            outline: none;
        }

        div.body button.clear-messages:hover {
            border-top: 1px solid rgba(156, 163, 175, 0.25);
            background-color: rgba(156, 163, 175, 0.15);
            color: rgba(55, 65, 81, 0.7);
        }
    </style>
</head>

<body>
    <div id="app">
        <div class="container">
            <div class="pixel">
                <div class="content">
                    <div class="topbar"></div>

                    <div class="heading ">
                        Messages
                    </div>

                    <div class="body">
                        <div class="message" v-for="({ message, recipient, date }, index) in messages" :key="index">
                            <div class="message-recipient">{{ recipient }}</div>
                            <div class="message-body" v-html="message">
                                Hey.
                            </div>
                            <div class="message-timestamp">{{ date }}</div>
                        </div>

                        <div class="grower"></div>
                        <button class="clear-messages" @click="clear">Clear Messages</button>
                    </div>
                </div>
            </div>
        </div>
    </div>
    <script src="https://js.pusher.com/7.0/pusher.min.js"></script>
    <script src="https://cdn.jsdelivr.net/npm/vue/dist/vue.js"></script>
    <script>
        Pusher.logToConsole = true;

        const pusher = new Pusher('<?php echo \Illuminate\Support\Facades\Config::get('sms-capture.pusher'); ?>', {
            cluster: 'ap1'
        });

        const channel = pusher.subscribe('<?php echo \Illuminate\Support\Facades\Config::get('sms-capture.broadcasting.channel'); ?>');

        function urlify(text) {
            return text.replace(/(https?:\/\/[^\s]+)/g, function(url) {
                return '<a href="' + url + '" target="_blank">' + url + '</a>';
            })
        };

        channel.bind('<?php echo \Illuminate\Support\Facades\Config::get('sms-capture.broadcasting.event'); ?>', function(data) {
            app.messages.push({
                message: urlify(data.message),
                recipient: data.recipient,
                date: data.date
            });
        });

        const app = new Vue({
            el: '#app',

            data: {
                messages: []
            },

            created () {
                const messages = window.localStorage.getItem('messages')

                if (messages) {
                    this.messages = JSON.parse(messages)
                }

                this.$watch('messages', function () {
                    const messages = [].concat(this.messages.map(message => ({ ...message })))

                    window.localStorage.setItem('messages', JSON.stringify(messages))
                }, { deep: true })
            },

            mounted () {
                const body = document.querySelector('div.content > div.body')

                body.scrollTo(0, body.scrollHeight)
            },

            methods: {
                clear () {
                    if (window.confirm('Are you sure you want to clear messages?')) {
                        this.messages = []
                    }
                }
            }
        });
    </script>
</body>
